import React from 'react';
import './Feed.css'
import PostBox from './Postbox/PostBox';
import Story from './Stroy/Story';

const Feed = () => {
  return (
    <div className='__feed'>
        <Story />
        <PostBox />
    </div>
  )
}

export default Feed
